import React, { Component } from 'react';

export class SearchBar extends Component {
    state = {
        title: ''
    }
    render() {
        return (
            <form style={{ display: 'flex' }}>
                <input
                    type="test"
                    name="title"
                    style={{flex: 10}}
                    placeholder="Add Ingredient"
                    value={this.state.title}
                    />
                    <input
                        type="submit"
                        value="Submit"
                        className="btn"
                        style={{flex: 1}}
                    />
            </form>
        )
    }
}

export default SearchBar
